INSERT INTO `wym_article` VALUES ('20', '8', '陪伴是最长情的告白(完整升级版)', '时长：07:47 <br/>\r\n制作周期：48小时内<br/>\r\n照片数量：21张<br/>\r\n背景音乐：自选<br/>\r\n制作说明：陪伴是最长情的告白 相守是最温暖的承诺 等待是最青涩的恋情 微笑是最美好的回忆 宽容是最真实的爱情,完整升级版,定制此视频联系QQ982089632', '<p><video class=\"edui-upload-video  vjs-default-skin video-js\" controls=\"\" preload=\"none\" width=\"420\" height=\"280\" src=\"/public/uploads/videos/20191005/1570242374388793.mp4\" data-setup=\"{}\"></video></p>', '120', '1', '49', '/public/uploads/20191005/9b33da13fba370a19a715b5bf774e3be.png', null, '0', '0', '0', '2019-10-05 08:12:26', '2019-10-05 08:12:23');
INSERT INTO `wym_article` VALUES ('21', '9', '用多肉拼盘向女神求爱，这表白技能让人佩服', '萌萌的多肉植物，非常讨人喜欢，女生对其更是没有抵抗力。下面分享的心形多肉拼盘，更是升级为表白神器！不多说，先看图。', '<p>&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(34, 34, 34); font-family: Consolas, \">当初因为女朋友的倔强，认为她是一个有个性的人，是我欣赏的一点，没想到，我们分手也是因为她这个个性，失恋小伙无奈的说到。她不想轻易被你感动，给自己再一次受伤的机会，除非让她确定你为她做出了改变，让她确信你们之间有明晰的未来。小编今天就来告诉大家，如何一步步挽回倔强女朋友。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, \">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(34, 34, 34); font-family: Consolas, \">你是否想要挽回女友,但都不知道怎么挽回，当你在面对感情问题时而不知所所措时，</span></span></p>', '小编', '1', '23', '/public/uploads/20191006/9713196955532e9cb0a95d67ee458263.png', null, '0', '0', '0', '2019-10-06 13:05:00', '2019-10-06 13:09:06');
INSERT INTO `wym_article` VALUES ('22', '10', '如何从朋友区走出来，变成恋爱关系', '很多男人会有这么一个情况：自己和一个非常喜欢的女孩子是朋友，不知道如何追求她。这篇文章要给你一些详细的解释和如何走出朋友区的操作原则。 首先，你要把朋友区和好人卡区', '<p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;很多男人会有这么一个情况：自己和一个非常喜欢的女孩子是朋友，不知道如何追求她。这篇文章要给你一些详细的解释和如何走出朋友区的操作原则。 首先，你要把‘朋友区’和‘好人卡’区分开来。‘好人卡’的概念：当你向女孩表白后，她对你说，她只对你有‘朋友’的感觉，并不希望和你进展成为恋人关系。‘朋友区’则是，你还没有表白，你和她是非常好的朋友。 这篇文章先不讨论好人卡的问题。我们先来看看朋友区。 如何走出朋友区？你首先需要明白一个关键的问题：不是所有的朋友区里的男女都是真正的朋友。</span></p><p><span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;<span style=\"color: rgb(34, 34, 34); font-family: Consolas, &quot;Lucida Console&quot;, &quot;Courier New&quot;, monospace; font-size: 12px; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">针对男人回答这个问题，我把是朋友的男女分成两类。第一类是女人对男人有感觉，等待男方主动；第二类是女人对男人没有感觉。如果你是第一类，那么你可以按照我后面的原则一来操作。如果你是第二类，那你就按原则二来操作。 所以这里的关键是判断。你判断的准确才会有后面的故事。我在这两个原则里都分别给你加上如何判断一个女孩对你有无好感的信号。</span></span></p>', 'admin', '1', '7', '/public/uploads/20191006/aa111d6021cad67403a68b242cc1668c.jpg', null, '0', '0', '0', '2019-10-06 13:41:51', '0000-00-00 00:00:00');
