INSERT INTO `wym_biaobai` VALUES ('25', '我爱你', '小白', '小黑', '/public/uploads/20191002/0e46b4338cb3bcc8c55279df253d990b.mp3', '2019-10-03', '我们的相遇是意外的，但这是一个美丽幸福的意外，让我遇到了这么好的你', '莎士比亚说过：爱情是一种甜蜜的痛苦，但是我愿意忍受这种痛苦，莎士比亚还说过，世界上没有比服侍爱情更快乐的了，你愿不愿意享受这种快乐？当然你是愿意的~嘿嘿?', '之前我不相信一见钟情，但是见到你的那一刻，我否定了我的看法。我的心为你沦陷，从此只为你跳动', '有一种爱的感觉，叫感同身受。有一种爱的默契，叫心有灵犀。有一种爱的承诺，叫天长地久', '2019-10-03', null, null, null, null, null, '/public/uploads/20191004/372cba9cbaad331ea04a002134ed4a11.png', null, null, null, null, null, '16', '1570182118');
INSERT INTO `wym_biaobai` VALUES ('26', '我爱你', '小白', '小何', '/public/uploads/20191002/0e46b4338cb3bcc8c55279df253d990b.mp3', '2019-10-03', '我们的相遇是意外的，但这是一个美丽幸福的意外，让我遇到了这么好的你', '莎士比亚说过：爱情是一种甜蜜的痛苦，但是我愿意忍受这种痛苦，莎士比亚还说过，世界上没有比服侍爱情更快乐的了，你愿不愿意享受这种快乐？当然你是愿意的~嘿嘿?', '之前我不相信一见钟情，但是见到你的那一刻，我否定了我的看法。我的心为你沦陷，从此只为你跳动', '有一种爱的感觉，叫感同身受。有一种爱的默契，叫心有灵犀。有一种爱的承诺，叫天长地久', '2019-10-03', null, null, null, null, null, '/public/uploads/20191004/a6e3f816b36869a6a143cb0f82514c0f.png', null, null, null, null, null, '15', '1570182227');
INSERT INTO `wym_biaobai` VALUES ('29', '我爱你', '小黑', '小白', '/public/uploads/20191002/0e46b4338cb3bcc8c55279df253d990b.mp3', '2019-10-04', '我们的相遇是意外的，但这是一个美丽幸福的意外，让我遇到了这么好的你', '莎士比亚说过：爱情是一种甜蜜的痛苦，但是我愿意忍受这种痛苦，莎士比亚还说过，世界上没有比服侍爱情更快乐的了，你愿不愿意享受这种快乐？当然你是愿意的~嘿嘿?', '之前我不相信一见钟情，但是见到你的那一刻，我否定了我的看法。我的心为你沦陷，从此只为你跳动', '有一种爱的感觉，叫感同身受。有一种爱的默契，叫心有灵犀。有一种爱的承诺，叫天长地久', '多庆幸世界那么大能和你相恋， 好骄傲你是爱我的，就那么一个你我真的很珍惜， 所有...所有的一切我只想用一句英文告诉你， You are the apple of my eyes', null, null, null, null, null, '/public/uploads/20191004/7d23db7ea0144c80d5a6194f5cb84c1d.png', null, null, null, null, null, '14', '1570199249');
INSERT INTO `wym_biaobai` VALUES ('30', '我爱你', '小黑', '小白', '/public/uploads/20191002/0e46b4338cb3bcc8c55279df253d990b.mp3', '莎士比亚还说过，世界上没有比服侍爱情更快乐的了，你愿不愿意享受这种快乐？', '你的出现，占满了我的视线，我愿跟随你永远！', '自从遇见你那天开始，我的心就像跌进深深的湖水，推不开躲不掉，心一直想往你身上靠', '只要你愿意，当你失落失意的时候，需要一个肩膊的时候，告诉我，我会立即出现', '之前我不相信一见钟情，但是见到你的那一刻，我否定了我的看法。我的心为你沦陷，从此只为你跳动', '有一种爱的感觉，叫感同身受。有一种爱的默契，叫心有灵犀。有一种爱的承诺，叫天长地久,有一种爱的方式，是执子之手,与子携老。', null, 'I LOVE YOU', null, null, null, null, null, null, null, null, null, '13', '1570200044');
INSERT INTO `wym_biaobai` VALUES ('31', '生日快了', '小白', '小黑', '/public/uploads/20191002/0e46b4338cb3bcc8c55279df253d990b.mp3', null, '亲爱的宝贝', '在你生日到来之际，我将快乐的音符，作为礼物送给你愿您拥有365个美丽的日子，衷心地祝福你，生日快乐！在此诚挚地献上我的三个祝愿：一愿你身体健康；二愿你幸福快乐；三愿你万事如意！', '送你一个生日蛋糕，祝你生日快乐！第一层，体贴！第二层，关怀！第三层，浪漫！第四层，温馨！中间夹层，甜蜜！祝你天天都有一份好心情！', null, null, null, null, null, null, null, null, null, null, null, null, null, '12', '1570201810');
INSERT INTO `wym_biaobai` VALUES ('32', '我爱你', '小白', '小何', '/public/uploads/20191002/d116013450a941cbebf536927779bc62.mp3', '那时我的心七上八下的，我相信这就是一见钟情', '亲爱的，做我女朋友吧！', '你是一个活泼 可爱的女孩 很善良，天真浪漫', '虽然我们接触的时间不长，只有短短几个月', '却让我感觉是那么的熟悉与开心', '难以忘记初次见面的感觉，我被一种神奇的东西吸引', null, '那以后，你的一个微笑，一个表情，都深深的留在了我的心里', '我一次次的更加确定，你就是我一直等待的人', '只要你愿意,我可以陪你去任何你想去的地方', '只要你愿意,我可以陪你去吃任何你喜欢吃的东西', null, null, null, null, null, null, '11', '1570202842');
INSERT INTO `wym_biaobai` VALUES ('33', '我爱你', '小白', '小黑', '/public/uploads/20191002/0e46b4338cb3bcc8c55279df253d990b.mp3', '有一种爱的方式，是执子之手,与子携老', '你的出现，占满了我的视线，我愿跟随你永远', '自从遇见你那天开始，我的心就像跌进深深的湖水，推不开躲不掉，心一直想往你身上靠', '只要你愿意，当你失落失意的时候，需要一个肩膊的时候，告诉我，我会立即出现', '之前我不相信一见钟情，但是见到你的那一刻，我否定了我的看法。我的心为你沦陷，从此只为你跳动', '有一种爱的感觉，叫感同身受。有一种爱的默契，叫心有灵犀。有一种爱的承诺，叫天长地久', null, '莎士比亚说过：爱情是一种甜蜜的痛苦，但是我愿意忍受这种痛苦', '莎士比亚还说过，世界上没有比服侍爱情更快乐的了，你愿不愿意享受这种快乐？', 'I LOVE YOU', null, null, null, null, null, null, null, '10', '1570203742');
